import React, { Component } from "react";
import "./App.css";
import TextField from "@material-ui/core/TextField";
import Button from "styled-button-component";
import { ButtonToolbar } from "styled-button-component/lib/components/ButtonToolbar";

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      first_name: "",
      last_name: "",
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div className="login">
        <div>
          <TextField id="standard-name" label="Username" margin="normal" />
        </div>
        <div>
          <TextField id="standard-name" label="Password" margin="normal" />
        </div>
        <div>
          <ButtonToolbar>
            <Button variant="primary">Test</Button>
          </ButtonToolbar>
        </div>
      </div>
    );
  }
}

export default Login;
